INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P455936', 'Lip Butter Balm for Hydration & Shine', 'Summer Fridays', '/product/summer-fridays-lip-butter-balm-P455936?skuId=2495505', 24, 4.3408, 'https://www.sephora.com/productimages/sku/s2495505-main-zoom.jpg?imwidth=270&pb=allure-2024-bestofbeauty', 'Summer Fridays - Lip Butter Balm for Hydration & Shine', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499093', 'Lip Balms & Treatments', '<b>Suggested Usage:<br></b>-Use when your lips need extra hydration throughout the day&mdash;or as an overnight mask.<br><b><br>Recycling Instructions:<br></b>-Upon unboxing, flatten the unit carton and liner and place in the recycling bin.<br>-Once you&rsquo;ve finished the balm, remove and discard the cap and then recycle the plastic tube.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P427417', 'Niacinamide 10% + Zinc 1% Oil Control Serum', 'The Ordinary', '/product/the-ordinary-deciem-niacinamide-10-zinc-1-P427417?skuId=2031391', 6, 4.2398, 'https://www.sephora.com/productimages/sku/s2031391-main-zoom.jpg?imwidth=270', 'The Ordinary - Niacinamide 10% + Zinc 1% Oil Control Serum', 'SEPHORA', 'SKINCARE', true, true, false, '2024-12-27 16:17:10.499136', 'Face Serums', '<p><strong>Suggested Usage:<br></strong>-Apply a few drops to entire face in morning and evening before heavier creams.</p><p><br></p><p>Precautions:</p><p>-If topical vitamin C is used as part of skincare, it should be applied at alternate times with this formula in the AM. Otherwise, niacinamide can affect integrity of pure-form vitamin C.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P480529', 'Power Mist Hydrating Hand Sanitizer', 'Touchland', '/product/touchland-power-mist-hydrating-hand-sanitizer-P480529?skuId=2556785', 10, 4.287, 'https://www.sephora.com/productimages/sku/s2556785-main-zoom.jpg?imwidth=270&pb=allure-2024-bestofbeauty', 'Touchland - Power Mist Hydrating Hand Sanitizer', 'SEPHORA', 'SKINCARE', false, false, true, '2024-12-27 16:17:10.499164', 'Hand Sanitizer & Hand Soap', '<p><strong>Suggested Usage:</strong></p><p>Place enough product in your palm to thoroughly cover your hands.&nbsp;</p><p>Rub hands together until dry.</p><p><br></p><p><strong>Recycling Instructions:<br></strong></p><p>- Net-Zero Plastic Waste Certified brand.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P467762', 'Mini Watermelon Glow PHA + BHA Pore-Tight Toner', 'Glow Recipe', '/product/glow-recipe-mini-watermelon-glow-pha-bha-pore-tight-toner-P467762?skuId=2421519', 16, 4.2694, 'https://www.sephora.com/productimages/sku/s2421519-main-zoom.jpg?imwidth=270&pb=clean-planet-aware', 'Glow Recipe - Mini Watermelon Glow PHA + BHA Pore-Tight Toner', 'SEPHORA', 'SKINCARE', false, false, false, '2024-12-27 16:17:10.499178', 'Mini Size', '<p><strong>Suggested Usage:</strong></p><p >After cleansing in the AM and PM, dispense into your palms and gently press into your face and neck until fully absorbed.</p><p>- Can also be applied with a cotton pad.</p><p>- Follow with sunscreen during the day.</p><p>- Avoid eye area.</p><p>- Glow Tip: Follow with Watermelon Glow Niacinamide Dew Drops for a healthy dewy glow!</p><p><br></p><p><strong>&nbsp;Recycling Instructions:</strong></p><p>-Remove the cap and plastic inner lid.</p><p>-Wash the glass jar with hot water to fully remove any remaining product.</p><p>-Dry jar thoroughly.</p><p>-Up-cycle the glass jar or recycle it along with the plastic cap and inner lid per your local guidelines.</p><p>-Glow Recipe also offers a recycling send-back program with its partner TerraCycle® for products that cannot be recycled locally.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P427419', 'Hyaluronic Acid 2% + B5 Hydrating Serum', 'The Ordinary', '/product/the-ordinary-hyaluronic-acid-2-b5-hydrating-serum-P427419?skuId=2735132', 9.9, 4.3403, 'https://www.sephora.com/productimages/sku/s2735132-main-zoom.jpg?imwidth=270', 'The Ordinary - Hyaluronic Acid 2% + B5 Hydrating Serum', 'SEPHORA', 'SKINCARE', false, true, false, '2024-12-27 16:17:10.499188', 'Face Serums', '<b>Suggested Usage:<br></b>-Apply a few drops to the face in the morning and evening. <br>-If irritation occurs, rinse off, cease use, and consult a physician. <br>-Use only as directed on unbroken skin. <br>-Patch testing prior to use is advised. <br>-Keep out of reach of children.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P427406', 'Glycolic Acid 7% Exfoliating Toner', 'The Ordinary', '/product/the-ordinary-deciem-glycolic-acid-7-toning-solution-P427406?skuId=2031508', 8.7, 4.3304, 'https://www.sephora.com/productimages/sku/s2031508-main-zoom.jpg?imwidth=270', 'The Ordinary - Glycolic Acid 7% Exfoliating Toner', 'SEPHORA', 'SKINCARE', true, true, false, '2024-12-27 16:17:10.4992', 'Toners', '<b>Suggested Usage:<br></b>-Use ideally in the PM and do not exceed once-daily use.<br>-After cleaning, saturate a cotton pad with the formula and sweep across face and neck.<br>-Do not rinse off.<br>-Continue with additional skin treatments as needed.<br><br>Precautions:<br>-Avoid the eye contour and contact with eyes.<br>-This product contains an alpha hydroxy acid (AHA) that may increase your skin''s sensitivity to the sun and particularly the possibility of sunburn. Use a sunscreen, wear protective clothing, and limit sun exposure while using this product and for a week afterward.<br>-Use only as directed.<br>-Contact of the product with the skin must be of limited frequency or duration.<br>-This formula should not be used on sensitive, peeling, or compromised skin. If persistent irritation occurs, discontinue use and consult a physician.<br>-Please note that Tasmanian pepperberry derivative included in this formula is of plant origin and varies in color seasonally, and this color variation may be apparent in the formula from time to time.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P503655', 'Mini Grape Water Moisturizing Face Mist', 'Caudalie', '/product/caudalie-grape-water-moisturizing-face-mist-P503655?skuId=1434190', 12, 4.3698, 'https://www.sephora.com/productimages/sku/s1434190-main-zoom.jpg?imwidth=270&pb=clean-planet-aware', 'Caudalie - Mini Grape Water Moisturizing Face Mist', 'SEPHORA', 'SKINCARE', true, false, false, '2024-12-27 16:17:10.499215', 'Mists & Essences', '<b>Suggested Usage:<br></b>-Spritz on as a toner to clean face or at any time of the day to soothe, refresh, and moisturize skin.<br>-It quickly absorbs into skin, no need to blot.<br><br><b>Recycling Instructions:</b><br>-Bottle is 100 percent recyclable, and cap is recyclable through Terracycle&reg;.<br>-As a pioneer of sustainable beauty, Caudalie is committed to reducing packaging waste for all new and existing products by end of 2022, using less plastic, paper and metal to create recycled, recyclable or refillable packaging.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P448852', 'SOS Daily Rescue Facial Spray with Hypochlorous Acid', 'Tower 28 Beauty', '/product/sos-save-our-skin-daily-rescue-facial-spray-P448852?skuId=2527844', 12, 4.0486, 'https://www.sephora.com/productimages/sku/s2527844-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Tower 28 Beauty - SOS Daily Rescue Facial Spray with Hypochlorous Acid', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499229', 'Toners', '<p><strong>Suggested Usage:</strong></p><p>-Use morning and evening. </p><p>-For best results, spray on dry, freshly- cleansed skin.</p><p>-Let dry down completely before applying moisturizer.</p><p>-Use for blemishes, sunburns, rashes, eczema, post-workout, and post-procedure.</p><p><br></p><p><strong>Recycling Instructions:</strong></p><p>-New packaging is made from 100 percent post-consumer resin (recycled plastic). </p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P458219', 'Watermelon Glow PHA + BHA Pore-Tight Toner', 'Glow Recipe', '/product/glow-recipe-watermelon-glow-pha-bha-pore-tight-toner-P458219?skuId=2348431', 16, 4.2694, 'https://www.sephora.com/productimages/sku/s2348431-main-zoom.jpg?imwidth=270&pb=clean-planet-aware', 'Glow Recipe - Watermelon Glow PHA + BHA Pore-Tight Toner', 'SEPHORA', 'SKINCARE', true, true, false, '2024-12-27 16:17:10.499242', 'Toners', '<p><strong>Suggested Usage:<br></strong></p><p >- After cleansing in the AM and PM, dispense into your palms and gently press into your face and neck until fully absorbed.</p><p>- Can also be applied with a cotton pad.</p><p>- Follow with sunscreen during the day.</p><p>- Avoid eye area.</p><p>- Glow Tip: Follow with Watermelon Glow Niacinamide Dew Drops for a healthy dewy glow!</p><p><br></p><p><strong>Recycling Instructions:<br></strong>-Remove the cap and plastic inner lid.</p><p>-Wash the glass jar with hot water to fully remove any remaining product.</p><p>-Dry jar thoroughly.</p><p>-Up-cycle the glass jar or recycle it along with the plastic cap and inner lid per your local guidelines.</p><p>-Glow Recipe also offers a recycling send-back program with its partner TerraCycle® for products that cannot be recycled locally.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P443563', 'Lip Glowy Lightweight Hydration Balm with Shea Butter', 'LANEIGE', '/product/glowy-lip-balm-P443563?skuId=2743342', 19, 4.3863, 'https://www.sephora.com/productimages/sku/s2743342-main-zoom.jpg?imwidth=270', 'LANEIGE - Lip Glowy Lightweight Hydration Balm with Shea Butter', 'SEPHORA', 'SKINCARE', true, false, false, '2024-12-27 16:17:10.499251', 'Lip Balms & Treatments', '<p><strong>Suggested Usage:<br></strong>-Apply directly to lips as needed.</p><p>-Use alone or before lip color to prime.</p><p>-Use after lip color for shine.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P448853', 'Mini SOS Daily Rescue Facial Spray with Hypochlorous Acid', 'Tower 28 Beauty', '/product/sos-save-our-skin-daily-rescue-facial-spray-mini-P448853?skuId=2527836', 12, 4.0486, 'https://www.sephora.com/productimages/sku/s2527836-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Tower 28 Beauty - Mini SOS Daily Rescue Facial Spray with Hypochlorous Acid', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499259', 'Toners', '<b>Suggested Usage:<br></b>-Use morning and evening. <br>-For best results, spray on dry, freshly- cleansed skin.<br>-Let dry down completely before applying moisturizer.<br>-Use for blemishes, sunburns, rashes, eczema, post-workout, and post-procedure.<br><br><b>Recycling Instructions:<br></b>-New packaging is made from 100 percent post-consumer resin (recycled plastic). Bottle is also fully recyclable, just remove the cap.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P461522', 'Purifying Charcoal Nose Pore Strip', 'SEPHORA COLLECTION', '/product/sephora-collection-purifying-charcoal-nose-pore-strip-P461522?skuId=2707701', 3, 3.3129, 'https://www.sephora.com/productimages/sku/s2707701-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'SEPHORA COLLECTION - Purifying Charcoal Nose Pore Strip', 'SEPHORA', 'SKINCARE', true, false, true, '2024-12-27 16:17:10.499268', 'Sheet Masks', '<p><strong>Suggested Usage:<br></strong>-Use twice a week.</p><p>-Remove makeup and clean nose.</p><p>-Do not dry completely, leave skin damp.</p><p>-Remove the transparent, protective film.</p><p>-Apply the strip onto slightly damp nose skin with the shiny side against the skin.</p><p>-Leave it on for 10 minutes.</p><p>-Peel the strip off.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P420652', 'Lip Sleeping Mask Intense Hydration with Vitamin C', 'LANEIGE', '/product/lip-sleeping-mask-P420652?skuId=2371367', 24, 4.3176, 'https://www.sephora.com/productimages/sku/s2371367-main-zoom.jpg?imwidth=270', 'LANEIGE - Lip Sleeping Mask Intense Hydration with Vitamin C', 'SEPHORA', 'SKINCARE', false, false, false, '2024-12-27 16:17:10.499278', 'Lip Balms & Treatments', '<p><strong>Suggested Usage:<br></strong>-Apply generously to the lips in the evening and leave on overnight.</p><p>-Gently wipe off excess in the morning as needed.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P510898', 'Eye Mask Patches for Dark Circles + De-Puffing', 'SEPHORA COLLECTION', '/product/eye-mask-patches-for-dark-circles-de-puffing-P510898?skuId=2707685', 4, 4.4444, 'https://www.sephora.com/productimages/sku/s2707685-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'SEPHORA COLLECTION - Eye Mask Patches for Dark Circles + De-Puffing', 'SEPHORA', 'SKINCARE', true, false, true, '2024-12-27 16:17:10.499287', 'Eye Masks', '<p><strong>Suggested Usage:<br></strong>-Remove one protective film.</p><p>-Place the patch under the eye.</p><p>-Remove the two other films and place the second patch.</p><p>-Leave on for five minutes, then remove and massage any excess product into the skin.</p><p>-No need to rinse.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P510932', 'Moisturizing Cherry Lip Mask', 'SEPHORA COLLECTION', '/product/moisturizing-cherry-lip-mask-P510932?skuId=2707735', 3, 3.7813, 'https://www.sephora.com/productimages/sku/s2707735-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'SEPHORA COLLECTION - Moisturizing Cherry Lip Mask', 'SEPHORA', 'SKINCARE', true, false, true, '2024-12-27 16:17:10.499295', 'Lip Balms & Treatments', '<b>Suggested Usage:<br></b>-Peel off the first moisturizing mask protective film.<br>-Apply the moisturizing mask to your lips and press so it sticks to the skin. Peel off the second protective film.<br>-Leave on lips for five minutes, then remove and gently massage in any remaining product.<br>-No need to rinse.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P511705', 'Hydrocolloid Invisible Pimple Patches + Salicylic Acid', 'The INKEY List', '/product/the-inkey-list-hydrocolloid-invisible-pimple-patches-P511705?skuId=2787968', 9, 4.7879, 'https://www.sephora.com/productimages/sku/s2787968-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'The INKEY List - Hydrocolloid Invisible Pimple Patches + Salicylic Acid', 'SEPHORA', 'SKINCARE', false, true, false, '2024-12-27 16:17:10.499303', 'Blemish & Acne Treatments', '<b>Suggested Usage:<br></b>-Use morning and evening.  ​<br>-Gently tear sheet to lift individual patch.<br>-Apply directly onto cleansed, dry skin to cover imperfection. ​<br>-Leave on for four or more hours (or overnight) then remove and dispose. Reapply a new patch as needed.​<br>-To keep in place, avoid applying multiple layers of skincare and/or makeup over the patch.​<br>-Store remaining patches in the pouch provided.<br><br><b>Recycling Instructions:<br></b>-Outer carton and sheet are recycle ready*. ​<br>-Separate paper and plastic on pouch before recycling. ​<br>​<br>*Recycling is subject to local policies and facilities, please check your local municipality guidelines.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P514680', 'Delícia Drench™ Moisturizing Shower Oil for Dry Skin', 'Sol de Janeiro', '/product/delicia-drench-tm-moisturizing-shower-oil-for-dry-skin-P514680?skuId=2830891', 10, 4.8827, 'https://www.sephora.com/productimages/sku/s2830891-main-zoom.jpg?imwidth=270', 'Sol de Janeiro - Delícia Drench™ Moisturizing Shower Oil for Dry Skin', 'SEPHORA', 'SKINCARE', false, false, false, '2024-12-27 16:17:10.499321', 'Body Wash & Shower Gel', '<b>Suggested Usage:<br></b>-Work into wet skin, gently massaging as you go, allowing a few moments for the product to transform from a luxurious oil to a low-lather milky cleanser. <br>-Rinse away to reveal soft and touchable skin. <br>-Hot Tip: This rich, comforting formula doubles as a shave oil.<br><br><b>Recycling Instructions:<br></b>-All sizes are 100 percent recyclable. <br>-Rinse components prior to recycling.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P411387', 'Superfood Gentle Antioxidant Refillable Cleanser', 'Youth To The People', '/product/kale-spinach-green-tea-age-prevention-cleanser-P411387?skuId=1863588', 16, 4.1639, 'https://www.sephora.com/productimages/sku/s1863588-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Youth To The People - Superfood Gentle Antioxidant Refillable Cleanser', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499334', 'Face Wash & Cleansers', '<p><strong>Suggested Usage:<br></strong>-Use twice daily, in the morning and evening.</p><p>-Wet face first. Put one to two pumps of Superfood face cleanser into wet hands, rub together into a light lather, and massage into face and neck for 30 seconds to activate the cold-pressed antioxidants.</p><p>-Rinse thoroughly.</p><p><br></p><p>Tip:</p><p>-For best makeup removal, massage one to two pumps of Superfood face cleanser into dry or slightly damp face and neck. Add more water gradually as you massage for one minute. Rinse thoroughly</p><p><br></p><p>Pair with our Superfruit Cleanser as a treatment at least 3x a week, AM or PM to gently exfoliate the skin for a smooth, soft + radiant complexion.&nbsp;</p><p><br></p><p><strong>Recycling Instructions:<br></strong>-Take off the cap and dispose into its proper container.</p><p>-Check your local recycling authority''s guidelines to make sure you use the correct one.</p><p>-Wash the glass jar thoroughly in hot soapy water.</p><p>-Rinse, then dry. If you skip this step, containers may contaminate other materials in a mixed-waste stream, like paper.</p><p>-Place in your recycling bin and voila! Your glass jar can now be infinitely recycled.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P505233', 'Honey Infused Hydrating Lip Oil', 'Gisou', '/product/gisou-lip-oil-P505233?skuId=2683464', 28, 4.1945, 'https://www.sephora.com/productimages/sku/s2683464-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Gisou - Honey Infused Hydrating Lip Oil', 'SEPHORA', 'SKINCARE', false, true, true, '2024-12-27 16:17:10.499343', 'Lip Balms & Treatments', '<p><strong>Suggested Usage:<br></strong>-Glide directly onto bare lips or underneath/over your favorite lip product for extra dimension, hydration, and shine.</p><p><br></p><p>Pro tip:</p><p>-For the softest, smoothest finish, cleanse and exfoliate lips before applying.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P448854', 'ShineOn Lip Jelly Hydrating Non-Sticky Lip Gloss', 'Tower 28 Beauty', '/product/shineon-lip-jelly-P448854?skuId=2549970', 16, 4.4914, 'https://www.sephora.com/productimages/sku/s2549970-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Tower 28 Beauty - ShineOn Lip Jelly Hydrating Non-Sticky Lip Gloss', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499351', 'Lip Gloss', '<b>Suggested Usage:</b><br>-Swipe on over bare lips or over your favorite lip color for soft, glossy lips.');
