INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P406712', 'B-Hydra™ Intensive Hydration Serum with Hyaluronic Acid', 'Drunk Elephant', '/product/b-hydra-intensive-hydration-gel-P406712?skuId=1785856', 49, 4.2717, 'https://www.sephora.com/productimages/sku/s1785856-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Drunk Elephant - B-Hydra™ Intensive Hydration Serum with Hyaluronic Acid', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499377', 'Face Serums', '<p><strong>Suggested Usage:</strong></p><p>-Apply one pump to a clean, dry face, neck, chest, hands, or any place needing increased hydration. Mix with any Drunk Elephant serum, oil, or cream to lock it in. </p><p>-TIP: Exfoliate regularly to ensure maximum absorption of the product. </p><p>-Skincare Smoothie Tip: At night, try a Drunk Elephant Good to Glow Smoothie by mixing 1 pump T.L.C. Framboos + 1 pump B-Hydra + 2-3 drops of A-Gloei in the palm of your hand and applying it all over for smoother, hydrated and glowing skin.
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P509440', 'The Base Face Milk Essence & Lightweight Moisturizer with Hyaluronic Acid', 'ILIA', '/product/ilia-base-face-milk-P509440?skuId=2739837', 28, 4.4784, 'https://www.sephora.com/productimages/sku/s2739837-main-zoom.jpg?imwidth=270&pb=allure-2024-bestofbeauty', 'ILIA - The Base Face Milk Essence & Lightweight Moisturizer with Hyaluronic Acid', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499386', 'Moisturizers', '<b>Suggested Usage:<br></b>-Morning and night, give the bottle two to three shakes into your palms. <br>-Rub palms together and gently press into skin. <br>-For oily skin, use it like a lightweight moisturizer at the end of your skincare routine. <br>-For dry skin, layer it underneath your moisturizer for an extra boost of hydration. <br>-For sensitive skin, apply it before your actives for extra skin barrier support.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P442744', 'Watermelon Glow Ultra-Fine Mist', 'Glow Recipe', '/product/watermelon-glow-ultra-fine-mist-P442744?skuId=2207231', 29, 4.1541, 'https://www.sephora.com/productimages/sku/s2207231-main-zoom.jpg?imwidth=270&pb=clean-planet-aware', 'Glow Recipe - Watermelon Glow Ultra-Fine Mist', 'SEPHORA', 'SKINCARE', true, true, false, '2024-12-27 16:17:10.499397', 'Mists & Essences', '<b>Suggested Usage:</b><br>-For oily/combination skin, spray it once every few hours to refresh skin. ⁣<br>-For drier skin types, hold it closer to your skin and apply two spritzes every two hours to maintain hydration.⁣');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P441101', 'The Dewy Skin Cream Plumping & Hydrating Refillable Moisturizer', 'Tatcha', '/product/the-dewy-skin-cream-P441101?skuId=2785434', 23, 4.083, 'https://www.sephora.com/productimages/sku/s2785434-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Tatcha - The Dewy Skin Cream Plumping & Hydrating Refillable Moisturizer', 'SEPHORA', 'SKINCARE', false, true, true, '2024-12-27 16:17:10.499406', 'Moisturizers', '<b>Suggested Usage:</b><br>-Scoop a pearl-sized amount of cream with the gold spoon. <br>-Massage onto face, neck, and d&#233;colletage in upward strokes. <br>-Use daily, morning and night.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P509295', 'Mini Glycolic Acid 7% Exfoliating Toner', 'The Ordinary', '/product/the-ordinary-mini-glycolic-acid-7-exfoliating-toning-solution-P509295?skuId=2714384', 8.7, 4.6451, 'https://www.sephora.com/productimages/sku/s2714384-main-zoom.jpg?imwidth=270', 'The Ordinary - Mini Glycolic Acid 7% Exfoliating Toner', 'SEPHORA', 'SKINCARE', true, true, false, '2024-12-27 16:17:10.499414', 'Toners', '<b>Suggested Usage:<br></b>-Use ideally in the PM and do not exceed once-daily use.<br>-After cleaning, saturate a cotton pad with the formula and sweep across face and neck.<br>-Do not rinse off.<br>-Continue with additional skin treatments as needed.<br><br>Precautions:<br>-Avoid the eye contour and contact with eyes.<br>-This product contains an alpha hydroxy acid (AHA) that may increase your skin''s sensitivity to the sun and particularly the possibility of sunburn. Use a sunscreen, wear protective clothing, and limit sun exposure while using this product and for a week afterward.<br>-Use only as directed.<br>-Contact of the product with the skin must be of limited frequency or duration.<br>-This formula should not be used on sensitive, peeling, or compromised skin. If persistent irritation occurs, discontinue use and consult a physician.<br>-Please note that Tasmanian pepperberry derivative included in this formula is of plant origin and varies in color seasonally, and this color variation may be apparent in the formula from time to time.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P505350', 'Cleansing + Exfoliating Wipes', 'SEPHORA COLLECTION', '/product/sephora-collection-cleansing-exfoliating-wipes-P505350?skuId=2558542', 4, 4.0837, 'https://www.sephora.com/productimages/sku/s2558542-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'SEPHORA COLLECTION - Cleansing + Exfoliating Wipes', 'SEPHORA', 'SKINCARE', true, false, true, '2024-12-27 16:17:10.499422', 'Face Wipes', '<b>Suggested Usage:<br></b>Cleansing:<br>-Twice a day, wipe your face and eyes with a cleansing wipe to remove all traces of makeup.<br>-If necessary, focus on the areas with heavy makeup, such as lips and eyelashes.<br>-Do not rinse after use.<br>-Dispose of the wipe. <br>-Make sure you properly close the top of the pack after use. <br><br>Exfoliating: <br>-Once a day, wipe all over your face, taking care to avoid contact with your eyes.<br>-Focus on the T-zone (forehead, nose, chin) in case of impurities.<br>-No need to rinse.<br>-Dispose of the wipe. <br>-Make sure you properly close the top of the pack after use. ');
