INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P472072', 'Brazilian Crush Cheirosa ’40 Bom Dia Hair & Body Fragrance Mist', 'Sol de Janeiro', '/product/sol-de-janeiro-brazilian-crush-cheriosa-40-hair-body-fragrance-mist-P472072?skuId=2461812', 25, 4.5455, 'https://www.sephora.com/productimages/sku/s2461812-main-zoom.jpg?imwidth=270', 'Sol de Janeiro - Brazilian Crush Cheirosa ’40 Bom Dia Hair & Body Fragrance Mist', 'SEPHORA', 'SKINCARE', false, false, false, '2024-12-27 16:17:10.499484', 'Body Mist & Hair Mist', '<b>Suggested Usage:<br></b>-Spray it anywhere, and everywhere, including your body, hair, clothes, and lingerie&mdash;that&rsquo;s the Sol de Janeiro way and so cheirosa. <br>-Mist all the time for the lingering scent of black amber plum, vanilla woods, and jasmine blooms.  <br><br><b>Recycling Instructions:<br></b>-Separate cap and pump from the bottle and place in recycling bin.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P442563', 'AHA 30% + BHA 2% Exfoliating Peeling Solution', 'The Ordinary', '/product/aha-30-bha-2-peeling-solution-P442563?skuId=2210607', 9.5, 4.4671, 'https://www.sephora.com/productimages/sku/s2210607-main-zoom.jpg?imwidth=270', 'The Ordinary - AHA 30% + BHA 2% Exfoliating Peeling Solution', 'SEPHORA', 'SKINCARE', true, true, false, '2024-12-27 16:17:10.499492', 'Facial Peels', '<b>Suggested Usage:<br></b>-Apply to a clean, dry face.<br>-Leave on for 10 minutes, then rinse with lukewarm water.<br>-Use ideally in the PM, no more frequently than twice per week.<br><br>Precautions:<br>-Do not use on wet skin.<br>-Do not leave on for longer than 10 minutes.<br>-If persistent irritation occurs, discontinue use and consult a physician.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P466123', 'Watermelon Glow Niacinamide Dew Drops Serum', 'Glow Recipe', '/product/glow-recipe-watermelon-glow-niacinamide-dew-drops-P466123?skuId=2404846', 20, 4.2798, 'https://www.sephora.com/productimages/sku/s2404846-main-zoom.jpg?imwidth=270&pb=clean-planet-aware', 'Glow Recipe - Watermelon Glow Niacinamide Dew Drops Serum', 'SEPHORA', 'SKINCARE', true, true, false, '2024-12-27 16:17:10.499501', 'Face Serums', '<b>Suggested Usage:<br></b>As a brightening serum step:<br>-Apply one pump before moisturizer to get long-lasting, glowing skin results.<br><br>As a priming step: <br>-Apply one to two pumps as the last step in your skin-care routine before makeup.<br><br>For a Maximum Glow:<br>-On a no-makeup day, apply one to two pumps as the last step of your entire routine. <br><br>Extra Dew Drops Hacks:<br>-Over makeup: pick up the formula using the ring finger and dab off excess on the back of your hand. <br>-Then gently pat &quot;a drop of dew&quot; on the high points of the face in a tapping motion.<br><br>As a primer:  <br>-Apply one to two pumps as the last step in your skin-care routine before makeup for a smooth finish and glow. <br>-Mix with foundation: Mix &quot;a drop of dew&quot; into foundation for a boost of hydration and glow.<br><br>For your eyes: <br>-Dab a pea-size amount to the center of the eyelid and blend out.<br><br>For a Double Highlight: <br>-Pat a drop below complexion makeup and then layer with a powder highlighter on top.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P469502', 'Skin Perfecting 2% BHA Liquid Exfoliant for Clear Skin', 'Paula''s Choice', '/product/paula-s-choice-skin-perfecting-2-bha-liquid-exfoliant-P469502?skuId=2421360', 14, 4.3176, 'https://www.sephora.com/productimages/sku/s2421360-main-zoom.jpg?imwidth=270', 'Paula''s Choice - Skin Perfecting 2% BHA Liquid Exfoliant for Clear Skin', 'SEPHORA', 'SKINCARE', false, true, false, '2024-12-27 16:17:10.49951', 'Exfoliators', '<p><strong>Suggested Usage:</strong></p><p>-Apply once or twice daily after cleansing and toning.</p><p>-Gently shake 1–2x onto hands or a cotton pad. Provides up to 120 uses.</p><p>-Apply to face and neck (avoid contact with your lash line and eyelids).</p><p>-Do not rinse.</p><p>-Follow with serum and/or moisturizer.</p><p>-For daytime wear, always finish with SPF 30+.</p><p><br></p><p>Start Slowly: Apply every other day and note skin''s response. Then use up to twice daily. For daytime, always finish with SPF 30+. For nighttime, follow with the rest of your routine. If you have a salicylate allergy, check with your physician before using any products that contain salicylic acid.C81</p><p><br></p><p><br></p><p><strong>Recycling Instructions:</strong></p><p>Recycle Paula''s Choice products through TerraCycle.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P443840', 'Caffeine De-puffing + Dark Circle Eye Cream', 'The INKEY List', '/product/caffeine-eye-cream-P443840?skuId=2211514', 11, 3.958, 'https://www.sephora.com/productimages/sku/s2211514-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'The INKEY List - Caffeine De-puffing + Dark Circle Eye Cream', 'SEPHORA', 'SKINCARE', false, true, true, '2024-12-27 16:17:10.499518', 'Eye Creams & Treatments', '<p><strong>Suggested Usage:</strong></p><p>-Use daily, morning and night</p><p>- Squeeze a pea-sized amount onto the tip of your ring finger</p><p>-Gently pat around the contour of the eye</p><p>- Follow with preferred serums and moisturizer to complete your skincare routine</p><p>-Always finish with SPF for your AM routine</p><p><br></p><p>INKEY Tip: Keeping your Caffeine Eye Cream in the fridge will give an extra cooling benefit on application to leave the skin looking depuffed and instantly cool.</p><p><br></p><p><strong>Recycling Instructions:</strong></p><p>-Separate the cap and tube&nbsp;</p><p>-Cut off the top of tube</p><p>-Use excess product and rinse tube&nbsp;</p><p>-Recycle packaging</p><p>Recycling is subject to local policies and facilities.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P511544', 'Saccharomyces Ferment 30% Milky Toner', 'The Ordinary', '/product/the-ordinary-saccharomyces-ferment-30-milky-toner-P511544?skuId=2768083', 14, 4.4616, 'https://www.sephora.com/productimages/sku/s2768083-main-zoom.jpg?imwidth=270&pb=allure-2024-bestofbeauty', 'The Ordinary - Saccharomyces Ferment 30% Milky Toner', 'SEPHORA', 'SKINCARE', false, true, false, '2024-12-27 16:17:10.499526', 'Toners', '<b>Suggested Usage:<br></b>-Apply in the morning and evening.<br>-Apply to your face and neck using a cotton pad or your fingers.<br>-Do not rinse off.<br>-Avoid eye contour and contact with eyes.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P505897', 'Cream Skin Refillable Toner & Moisturizer with Ceramides and Peptides', 'LANEIGE', '/product/cream-skin-refillable-toner-moisturizer-with-ceramides-peptides-P505897?skuId=2671857', 6, 4.4207, 'https://www.sephora.com/productimages/sku/s2671857-main-zoom.jpg?imwidth=270&pb=allure-2023-bestofbeauty-badge', 'LANEIGE - Cream Skin Refillable Toner & Moisturizer with Ceramides and Peptides', 'SEPHORA', 'SKINCARE', false, false, false, '2024-12-27 16:17:10.499535', 'Moisturizers', '<b>Suggested Usage:<br></b>-Gently pat into skin in the morning and evening, after cleansing.<br>-Apply multiple layers for additional hydration as desired.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P512737', 'Booster Eye Mask Brightening + Vitamin C', 'SEPHORA COLLECTION', '/product/sephora-collection-booster-eye-mask-brightening-vitamin-c-P512737?skuId=2743318', 4, 4.7681, 'https://www.sephora.com/productimages/sku/s2743318-main-zoom.jpg?imwidth=270', 'SEPHORA COLLECTION - Booster Eye Mask Brightening + Vitamin C', 'SEPHORA', 'SKINCARE', true, true, false, '2024-12-27 16:17:10.499611', 'Eye Masks', '<b>Suggested Usage:<br></b>-Remove one protective film. <br>-Place the patch below one of your eyes. <br>-Remove the two other films. <br>-Place the second patch. <br>-Leave on for five minutes. <br>-Remove. <br>-Massage any excess product into the skin. <br>-No need to rinse.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P441323', 'Mini Blueberry Bounce Gentle Cleanser', 'Glow Recipe', '/product/blueberry-bounce-gentle-cleanser-mini-P441323?skuId=2188209', 10, 3.7397, 'https://www.sephora.com/productimages/sku/s2188209-main-zoom.jpg?imwidth=270&pb=clean-planet-aware', 'Glow Recipe - Mini Blueberry Bounce Gentle Cleanser', 'SEPHORA', 'SKINCARE', true, false, false, '2024-12-27 16:17:10.499634', 'Mini Size', '<b>Suggested Usage:</b><br>To use as a cleanser:<br>-Dispense one pump into wet palms and rub hands to create a lather. <br>-Massage gently onto skin. <br>-Rinse thoroughly with water. <br>-Follow with your usual skincare regimen. <br><br>To use as a makeup remover: <br>-Dispense two pumps into wet palms and gently massage into face and neck in small circular motions for a full minute to eliminate all traces of makeup. <br>-Rinse thoroughly with water. <br>-Follow with your usual skincare regimen. <br><br>To use as a mask: <br>-Apply a generous layer to clean, dry skin. <br>-After five minutes, rinse thoroughly with lukewarm water. <br>-Follow with your usual skincare regimen.    ');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P502966', 'Great Skin Instant Glow Serum with Niacinamide and Hyaluronic Acid', 'MERIT', '/product/merit-great-skin-instant-glow-serum-with-niacinamide-hyaluronic-acid-P502966?skuId=2512788', 38, 4.1799, 'https://www.sephora.com/productimages/sku/s2512788-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'MERIT - Great Skin Instant Glow Serum with Niacinamide and Hyaluronic Acid', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499646', 'Face Serums', '<p><strong>Suggested Usage:</strong></p><p>-Shake well. </p><p>-After cleansing and before moisturizer, warm serum in hands and press into skin. </p><p>-Can be applied after your other active serums to help lock in hydration and help improve texture over time. </p><p>-Applies like an essence with strength of a serum. </p><p>-Wears well with makeup or on its own.</p></p><p>-For Dry Skin: Use 3 pumps.</p><p>-For Normal Skin: Use 2 pumps.</p><p>-For Combination/ Oily skin: Use 1-2 pumps.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P469086', 'Facial Cleansing Pad', 'SEPHORA COLLECTION', '/product/sephora-collection-facial-cleansing-pad-P469086?skuId=2683209', 8, 4.7289, 'https://www.sephora.com/productimages/sku/s2683209-main-zoom.jpg?imwidth=270&pb=2023-03-sephora-value-2023', 'SEPHORA COLLECTION - Facial Cleansing Pad', 'SEPHORA', 'SKINCARE', false, false, false, '2024-12-27 16:17:10.499655', 'Facial Cleansing Brushes', '<b>Suggested Usage:<br></b>-Use with your favorite cleanser to remove stubborn dirt and grime.<br>-Allow to dry between uses.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P505336', 'Hydrating Hyaluronic Acid Face Masks', 'SEPHORA COLLECTION', '/product/sephora-collection-face-masks-fruit-plant-extracts-hydrating-hyaluronic-acid-P505336?skuId=2614394', 6, 4.5029, 'https://www.sephora.com/productimages/sku/s2614394-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'SEPHORA COLLECTION - Hydrating Hyaluronic Acid Face Masks', 'SEPHORA', 'SKINCARE', true, false, true, '2024-12-27 16:17:10.499666', 'Sheet Masks', '<b>Suggested Usage:<br></b>-Unfold the sheet mask.<br>-Apply mask to clean, dry skin.<br>-Leave the sheet mask on the face for ten minutes before removing.<br>-No need to rinse. <br>-Avoid contact with eyes. <br>-Use twice weekly.<br><br>Tip: <br>-Massage in any remaining serum using the Sephora Collection Rose Quartz Facial Roller (sold separately).<br><br><b>Recycling Instructions:<br></b>-The pouch is made with 16 percent recycled plastic and can be recycled. <br>-The sheet mask is compostable.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P468658', 'Super Volcanic AHA Pore Clearing Clay Mask', 'innisfree', '/product/innisfree-pore-clearing-clay-mask-P468658?skuId=2735777', 18, 4.5937, 'https://www.sephora.com/productimages/sku/s2735777-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'innisfree - Super Volcanic AHA Pore Clearing Clay Mask', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499675', 'Face Masks', '<b>Suggested Usage:<br></b>-Apply desired amount to your entire face or to specific areas of concern. <br>-Leave on for 10 minutes or until dry. <br>-Gently rinse by massaging in circular motions with lukewarm water. <br>-Use one to two times a week.<br><br><b>Recycling Instructions:<br></b>-innisfree partners with TerraCycle&reg; on a no-waste recycling program to give your empties a second life. <br>-Request your recycling envelope at https://www.terracycle.com/en-US/brigades/innisfree.<br>-Gather all your clean products, rinse them, and place them in any box.<br>-Log in to your TerraCycle&reg; account at terracycle.com to download and print a free shipping label.<br>-Drop your box off at the designated shipping provider.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P417312', 'Brazilian Crush Cheirosa ’62 Bum Bum Hair & Body Fragrance Mist', 'Sol de Janeiro', '/product/brazilian-crush-body-fragrance-mist-P417312?skuId=1930759', 25, 4.4204, 'https://www.sephora.com/productimages/sku/s1930759-main-zoom.jpg?imwidth=270', 'Sol de Janeiro - Brazilian Crush Cheirosa ’62 Bum Bum Hair & Body Fragrance Mist', 'SEPHORA', 'SKINCARE', false, false, false, '2024-12-27 16:17:10.49969', 'Body Mist & Hair Mist', '<b>Suggested Usage:</b><br>-Use all over the body any time, anywhere.<br>-Spray on hair, clothes, and lingerie for that lingering scent of pistachio caramel.
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P509844', 'Watermelon Glow Niacinamide Hue Drops Sun Glow Serum', 'Glow Recipe', '/product/glow-recipe-watermelon-glow-niacinamide-hue-drops-sun-glow-serum-P509844?skuId=2742195', 35, 4.417, 'https://www.sephora.com/productimages/sku/s2742195-main-zoom.jpg?imwidth=270&pb=clean-planet-aware', 'Glow Recipe - Watermelon Glow Niacinamide Hue Drops Sun Glow Serum', 'SEPHORA', 'SKINCARE', false, true, false, '2024-12-27 16:17:10.499698', 'Face Serums', '<p><strong>Suggested Usage:</strong> </p><p>-As the last step of your daytime skincare routine, blend one to two pumps onto the face and neck with fingertips for a natural, all-over warm glow. </p><p>-How to use for maximum glow: Warm up your foundation and add luminosity to the skin by mixing one to two pumps with your foundation. </p><p>-Spot use for a warm glow: Apply to the high points of the face including your hairline and cheekbones as a highlighter or contour. </p><p>-For your eyes (ophthalmologist-tested): Using fingers, dab a pea-size amount to the center of the eyelid and blend out for a quick and easy wash of color.</p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P503692', 'Plush Puddin’ Intensive Recovery Lip Mask With Pomegranate Sterols + Vitamin E', 'Fenty Skin', '/product/fenty-skin-rihanna-plush-puddin-intensive-recovery-lip-mask-with-pomegranate-sterols-vitamin-e-P503692?skuId=2619997', 23, 4.0667, 'https://www.sephora.com/productimages/sku/s2619997-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Fenty Skin - Plush Puddin’ Intensive Recovery Lip Mask With Pomegranate Sterols + Vitamin E', 'SEPHORA', 'SKINCARE', true, true, true, '2024-12-27 16:17:10.499709', 'Lip Balms & Treatments', '<b>Suggested Usage:<br></b>-Twist base counter-clockwise to use.<br>-Apply to lips as needed day or/and night.<br><br><b>Recycling Instructions:<br></b>-The protective outer box is recyclable.<br>-Made from 100 percent PCR (post-consumer recycled) material.<br>-The entire pot is recyclable.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P500307', 'Fenty Treatz Hydrating + Strengthening Lip Oil', 'Fenty Skin', '/product/cherry-treat-conditioning-lip-oil-P500307?skuId=2536423', 24, 4.2223, 'https://www.sephora.com/productimages/sku/s2536423-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Fenty Skin - Fenty Treatz Hydrating + Strengthening Lip Oil', 'SEPHORA', 'SKINCARE', false, true, true, '2024-12-27 16:17:10.499717', 'Lip Balms & Treatments', '<b>Suggested Usage:<br></b>-Apply as often as needed for quickly hydrated, smooth lips.<br><br><b>Recycling Instructions:<br></b>-Protective outer box is recyclable.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P307907', 'Nourishing and Protective Shea Butter Hand Cream', 'L''Occitane', '/product/hand-creams-P307907?skuId=482497', 13, 4.5166, 'https://www.sephora.com/productimages/sku/s482497-main-zoom.jpg?imwidth=270', 'L''Occitane - Nourishing and Protective Shea Butter Hand Cream', 'SEPHORA', 'SKINCARE', false, false, false, '2024-12-27 16:17:10.499726', 'Hand Cream & Foot Cream', '<p><strong>Suggested Usage:</strong></p><p>Massage cream onto the back of palms and cuticles. </p>');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P504636', 'Mini Watermelon Glow Niacinamide Dew Drops', 'Glow Recipe', '/product/mini-watermelon-glow-niacinamide-dew-drops-P504636?skuId=2640340', 20, 4.2798, 'https://www.sephora.com/productimages/sku/s2640340-main-zoom.jpg?imwidth=270&pb=clean-planet-aware', 'Glow Recipe - Mini Watermelon Glow Niacinamide Dew Drops', 'SEPHORA', 'SKINCARE', true, true, false, '2024-12-27 16:17:10.499734', 'Face Serums', '<b>Suggested Usage:<br></b>For a natural glow and brightening serum:<br>-Apply one pump before moisturizer for long-lasting, glowing skin results.<br>As a priming step: <br>-Apply one to two pumps as the last step in your skincare routine before makeup.<br><br>For a maximum glow:<br>-On a no-makeup day, apply one to two pumps as the last step of your entire routine. <br><br>Extra Dew Drops hacks:<br>-Over makeup: Pick up the formula, using the ring finger, and dab off excess on the back of your hand. Then gently pat &quot;a drop of dew&quot; on the high points of the face in a tapping motion.<br>-As a primer: Apply one to two pumps as the last step in your skincare routine before makeup for a smooth finish and glow. <br>-Mix with foundation: Mix &quot;a drop of dew&quot; into foundation for a boost of hydration and glow.<br>-For your eyes: Dab a pea-size amount to the center of the eyelid and blend out.<br>-For a double highlight: Pat a drop below complexion makeup and layer with a powder highlighter on top.');
INSERT INTO app.products (product_id, name, brand, url, price, rating, image_url, image_alt_text, source, category, is_vegan, is_cruelty_free, is_clean_at_sephora, created_at, type, suggested_usage) VALUES ('P509439', 'Dream Lip Oil for Moisturizing Sheer Coverage', 'Summer Fridays', '/product/summer-fridays-dream-lip-oil-P509439?skuId=2744696', 26, 3.7159, 'https://www.sephora.com/productimages/sku/s2744696-main-zoom.jpg?imwidth=270&pb=clean-at-sephora', 'Summer Fridays - Dream Lip Oil for Moisturizing Sheer Coverage', 'SEPHORA', 'SKINCARE', false, true, true, '2024-12-27 16:17:10.499742', 'Lip Oil', '<b>Suggested Usage:<br></b>-Apply to bare lips or layer over your favorite lip color or liner for added dimension.');
